import {  useSelector } from 'react-redux'
import { useState } from "react";
import createProject from '../services/createProject';

function AdminNewProject() {
  
    const [title, setTitle] = useState("");
    const [description, setDescription] = useState("");
    const [coverImg, setCoverImg] = useState("");
    const [type, setType] = useState("");
    const [tags, setTags] = useState({});
    const [date, setDate] = useState("");
    const [duration, setDuration] = useState("");
    const [context, setContext] = useState("");
    const [constraints, setConstraints] = useState({});
  
    const token = useSelector((state) => state.admin);
    const projectInfo = {
      "title": {title},
      "description": {description},
      "coverImg": {coverImg},
      "type": {type},
      "tags": {tags},
      "date": {date},
      "duration": {duration},
      "context": {context},
      "constraints": {constraints}
    }

    async function sendProject() {
      try {
        createProject(token, projectInfo)
      } catch (error) {
        alert(error.message)
      }

    }
  
    return (
      <main>
        <section>
          <h1>New Project</h1>
          <form onSubmit={(e) => e.preventDefault()}>
            <div className="input-wrapper">
              <label htmlFor="title">Project Title</label>
              <input type="text" id="title" value={title}
                     onChange={(event) => setTitle(event.target.value)} />
            </div>

            <div className="input-wrapper">
              <label htmlFor="description">Project description</label>
              <input type="text" id="description" value={description}
                     onChange={(event) => setDescription(event.target.value)} />
            </div>

            <div className="input-wrapper">
              <label htmlFor="coverImg">Cover Image</label>
              <input type="file" id="coverImg" value={coverImg}
                     onChange={(event) => setCoverImg(event.target.value)} />
            </div>

            <div className="input-wrapper">
              <label htmlFor="type"></label>
              <input type="text" id="type" value={type}
                     onChange={(event) => setType(event.target.value)} />
            </div>

            <div className="input-wrapper">
              <label htmlFor="tags">Tags</label>
              <input type="text" id="tags" value={tags}
                     onChange={(event) => setTags(event.target.value)} />
            </div>

            <div className="input-wrapper">
              <label htmlFor="date">Date</label>
              <input type="text" id="date" value={date}
                     onChange={(event) => setDate(event.target.value)} />
            </div>

            <div className="input-wrapper">
              <label htmlFor="duration">Duration</label>
              <input type="text" id="duration" value={duration}
                     onChange={(event) => setDuration(event.target.value)} />
            </div>

            <div className="input-wrapper">
              <label htmlFor="context">Context</label>
              <input type="text" id="context" value={context}
                     onChange={(event) => setContext(event.target.value)} />
            </div>

            <div className="input-wrapper">
              <label htmlFor="contraints">Contraints</label>
              <input type="text" id="" value={constraints}
                     onChange={(event) => setConstraints(event.target.value)} />
            </div>
  
            <button className="btn-primary" onClick={() => sendProject()}>Send</button>
          </form>
        </section>
      </main>
    );
  }
  
  export default AdminNewProject;
